class Mountain {
    constructor(
        mountainId,
        mountainName,
        elevation,
        moutainImageSrc,
        range
        ){
            this.mountainId = mountainId,
            this.mountainName = mountainName,
            this.elevation = elevation,
            this.moutainImageSrc = moutainImageSrc,
            this.range = range
    }
}

export default Mountain
